import React, { Component } from "react";
import "../css/login.css"


export default class SignUp extends Component {

    constructor(props){
        super(props);
        this.state={
            username:"",
            password:""
        }
    
        this.myChangeHandler=this.myChangeHandler.bind(this);
        this.mySubmitHandler=this.mySubmitHandler.bind(this);
     }
    myChangeHandler(event)
    {
        let nam = event.target.name;
        let val = event.target.value;
        this.setState({[nam]:val})
    }
    mySubmitHandler(event)
    {
        if(this.state.username.length>0 && this.state.password.length>0)
        {
    
            alert("hello "+this.state.username)
        }
        
    }

    render() {
        return (
            <div class="outer">
            <form onSubmit={this.mySubmitHandler}>
                <div className="Model">
                    <h2 className="tag">Register</h2>
                    <div className="form-group">
                    <label>First name</label>
                    <input type="text" name="firstname" onChange={this.myChangeHandler} value={this.state.firstname} className="form-control" placeholder="First name" />
                </div>

                <div className="form-group">
                    <label>Last name</label>
                    <input type="text" name="lastname" onChange={this.myChangeHandler} value={this.state.lastname} className="form-control" placeholder="Last name" />
                </div>

                <div className="form-group">
                    <label>Email</label>
                    <input name="email" onChange={this.myChangeHandler} value={this.state.username} className="form-control" type="email" placeholder="Email" />
                </div>

                <div className="form-group">
                    <label>Password</label>
                    <input name="password" onChange={this.myChangeHandler} value={this.state.password} className="form-control" type="password" placeholder="Password" />
                </div>

                <button type="submit" value="Register" className="bt" />
                <p className="forgot-password">
                    Already registered <a href="#">log in?</a>
                </p>
                </div>
            </form>
            </div>
            
        );
    }
}
